const useFetchPost = async ({ url, Data }) => {
	const response = await fetch(url, {
		method: 'POST',
		headers: {
			'Content-Type': 'application/json',
		},
		body: JSON.stringify(Data),
	})
	return { response }
}

export default useFetchPost
